import React from 'react';
import classes from "./CardCart.module.css";
import img from "../../../assets/game_img1.jpg"

const CardCart = () => {
    return (
        <div className={classes.container}>
            <div className={classes.card}>
                <img src={img} alt="" className={classes.img}/>
                <div className={classes.title}>Взрывные котята. Безумие, апокалипсис и котики</div>
                <div className={classes.counter}>
                    <div className={classes.count_btn}>+</div>
                    <div className={classes.quantity}>01</div>
                    <div className={classes.count_btn}>-</div>
                </div>
                <div className={classes.price}>1290 ₽</div>
                <div className={classes.old_price}>2090 ₽</div>
            </div>
        </div>
    );
};

export default CardCart;
